import React from "react";
import Grid from "@material-ui/core/Grid";

function Features() {
  return (
    <div>
      <Grid container>
        <Grid item xs={4}>
          one
        </Grid>
        <Grid item xs={4}>
          two
        </Grid>
        <Grid item xs={4}>
          three
        </Grid>
      </Grid>
    </div>
  );
}

export default Features;
